  return (
    <Center>
      <Flex direction='column'>
        <Heading fontSize='70px' mt='25%'>Welcome to Placeholder</Heading>
        <Text textAlign='center' fontSize='20px' fontWeight='bold'>The best recipe storing app</Text>
        <Link to='/signup' _hover={{color: 'red'}}>
          <Text textAlign='center' fontSize='40px' fontWeight='bold' style={{color: 'red'}}>
            Get Started Now
          </Text>
        </Link>
      </Flex>
    </Center>
  )
}

export default App;
